import Couple from './img/yeniev.jpeg'

export default function SearchAndBackground(){
  return(
    <div>
      <img style={{height: '90%', width: '100%'}} src={Couple} alt="img"/>
      <form id="search" class="d-flex">
        <input class="form-control me-2" type="search" placeholder="Enter an address, neigborhood, city, or ZIP code" aria-label="Search"/>
        <button class="btn btn-success" type="submit">Search</button>
      </form>
    </div>
  )
}
